<template>
	<view class="main">
		<view class="img"></view>
		<view class="accountBox">
			<input 
				type="text" 
				placeholder="请输入账号" 
				class="account"
				v-model="info.account_num"
				focus
			/>
			<!-- h5和app,写passward时type会失效 -->
			<input type="text" password placeholder="请输入密码" class="pwd" v-model="info.password"/>
		</view>
		<view class="actionPwd">
			<view @click="isCheck">
				<label class="radio">
					<radio :checked="ischeck" /><text>记住密码</text>
				</label>
			</view>
			<view @click="gotoForget">
				忘记密码
			</view>
		</view>
		<view class="btn">
			<button @click="login">登陆</button>
			<button @click="gotoRegister">注册</button>
		</view>
	</view>
</template>

<script>
	import { mapState , mapMutations } from 'vuex'
	export default {
		data() {
			return {
				ischeck:false,
				info:{
					account_num:'',
					password:'',
				}
			}
		},
		methods: {
			...mapMutations(['login']),
			// 控制勾不勾
			isCheck(){
				this.ischeck = !this.ischeck		
			},
			// 缓存到本地
			setStorage1(){
				if(this.ischeck){
					uni.setStorage({
						key:'userInfo',
						data:this.info
					})
					uni.setStorage({
						key:'ischeck',
						data:this.ischeck
					})
				}
			},
			gotoRegister(){
				uni.navigateTo({
					url: '/pages/login/registerPage/registerPage'
				})
			},
			gotoForget(){
				uni.navigateTo({
					url:'/pages/login/forgetPwd/forgetPwd'
				})
			},
			async login(){
				this.setStorage1()
				//先完成登陆请求
			await this.$myRequest({
					url:'/login',
					method:'POST',
					data:this.info,
				})
				//接受到user_id后，然后将id返回给vuex
				this.$store.commit('setUpUserId',res.data.data.user_id)
				uni.showToast({
					title:res.data.msg
				})
				setTimeout(()=>{
					uni.switchTab({
						url:'/pages/index/index'
					})
				},1500)
				
			}
		}
		,computed:mapState(['forcedLogin','isLogin']),
		onLoad() {
			//判断本地有无用户缓存
			uni.getStorage({
				key:'userInfo',
				success: (res) => {
					this.info = res.data
				}
			})
			uni.getStorage({
				key:'ischeck',
				success: (res) => {
					this.ischeck = res.data
				}
			})
		}
	}
</script>

